import React from 'react'

import ProjectCardData from './ProjectCardData';
import './ProjectCardData.scss';

const ProjectCard = () => {

    const dashboardData=[{
        projectName : "Cipla",
        logoUrl : "https://i.postimg.cc/Z9Wbf1Lk/stock-illustration-awesome-abstract-consulting-design-template-logo-icon-isolated-free.jpg",
        status : "INPROGRESS",
        startDate : "01-01-2022",
        endDate : "01-12-2022" ,
        numberOfBugs : 33,
        numberOfDependencies : 34,
        codeReviews : 44,
        unitTesting :55,
        delay : 45
    },
    ]
    return (
        <div>

                {dashboardData && dashboardData.map((data) =>
                    <ProjectCardData data={data} />
                )}
            </div>
    )
}

export default ProjectCard;
